INSERT INTO `adminnotification_inbox` VALUES (1,4,'2020-03-27 15:35:13','Deprecation Notice','Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.','',0,0),(2,4,'2020-04-08 16:41:38','Watch On-Demand Webinar: Seize the New Year‚Äì 5 Growth Strategies for 2020.','Magento experts Shannon Hane and Matthew Wasley from Adobe will share the latest eCommerce strategies to accelerate revenue growth in 2020. Watch now: http://bit.ly/2GPpb4b','http://bit.ly/2GPpb4b',0,0),(3,4,'2020-04-10 17:14:30','You are invited! Join our live webinar on April 23rd: The True Cost Savings of Magento Commerce 2.','Join us for The True Cost Savings of Magento Commerce 2 webinar on April 23rd. John Glasgow and Matt Boland from Adobe will discuss how your business can reduce operating costs and grow revenue. Leading solution partner Atwix will also share how they are helping customers launch innovative solutions to meet expectations in today‚Äôs environment. Register Now: https://bit.ly/2JRgJCX','https://bit.ly/2JRgJCX',0,0),(4,4,'2020-04-14 22:03:09','Upgrade to Magento Commerce with no payments for the first 3 months. ','Adobe is committed to supporting merchants during this challenging time. Upgrade to Magento Commerce 2 quickly and affordably with limited time offers. Pay nothing for the first 3 months, and our Magento Commerce launch package will get you up and running fast. Free Magento U classes will ensure your teams are fully equipped to take their digital operations to the next level. Learn more: https://bit.ly/2RBnk8M','https://bit.ly/2RBnk8M',0,0),(5,4,'2020-04-22 16:52:09','Join Tomorrow\'s Webinar: The True Cost Savings of Magento Commerce 2.','Join us for a live webinar tomorrow, April 23rd. John Glasgow and Tricia Lee from Adobe will discuss how your business can reduce operating costs and grow revenue. They will also review special limited time offers. Slava Kravchuk from Atwix, # 1 Contributing Partner, will also share a customer case study leading the way in innovative B2B retail experiences. Register Now: https://bit.ly/2JRgJCX','https://bit.ly/2JRgJCX',0,0),(6,1,'2020-04-28 18:29:06','Magento Open Source 2.3.5-p1 delivers important security updates and features ','The latest releases of Magento Open Source ‚Äì 2.3.5-p1 and 2.3.4-p2 ‚Äì are now generally available. The latest release of Magento Open Source includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you save time and maximize resources at Magento.com/blog. ','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),(7,4,'2020-05-04 18:02:10','One Platform to Rule them All','The lines between B2B and B2C commerce are blurring. B2C companies are adding wholesale storefronts while their traditionally B2B counterparts are increasingly selling direct to consumers.','http://bit.ly/2DPgAx0',0,0),(8,1,'2020-05-06 01:15:26','You are invited! Join our live webinar on May 21st: Fast-Track Your Move to Magento Commerce','Join our live webinar on May 21st: Fast-Track Your Move to Magento Commerce. 5x Magento Master, Brent Peterson, will share insider advice on getting your new Magento Commerce site to market in 30 days or less. Also, Tricia Lee from Adobe will cover limited-time offers designed to help merchants upgrade quickly and affordably. Register now: https://bit.ly/2L1lxpW','https://bit.ly/2L1lxpW',1,0),(9,4,'2020-05-11 23:43:35','5 Ways You Can Deliver Commerce to Your Customers','Now more than ever, eCommerce is helping individuals and communities satisfy their most essential needs. Discover the 5 ways brands are bringing commerce to their customers in our eGuide, The New Everywhere (and Every Device) Commerce. Learn more: https://bit.ly/2YIrL6l','https://bit.ly/2YIrL6l',0,0),(10,4,'2020-05-19 23:51:00','Webinar Tomorrow! Join our live webinar on May 21st: Fast-Track Your Move to Magento Commerce.','Join us tomorrow for our live webinar: Fast-Track Your Move to Magento Commerce. 5x Magento Master, Brent Peterson, will share insider advice on getting your new Magento Commerce site to market in 30 days or less. Also, Tricia Lee from Adobe will cover limited-time offers designed to help merchants upgrade quickly and affordably. Register now: https://bit.ly/2L1lxpW','https://bit.ly/2L1lxpW',0,0),(11,4,'2020-04-10 17:14:30','Watch On-On Demand: The True Cost Savings of Magento Commerce 2.','Join us for The True Cost Savings of Magento Commerce 2 webinar on April 23rd. John Glasgow and Matt Boland from Adobe will discuss how your business can reduce operating costs and grow revenue. Leading solution partner Atwix will also share how they are helping customers launch innovative solutions to meet expectations in today‚Äôs environment. Register Now: https://bit.ly/2JRgJCX','https://bit.ly/2JRgJCX',0,0),(12,4,'2020-05-26 00:00:00','6 days left: COVID-19 Mageplaza Support Campaign','Mageplaza Covid-19 Support Program ends on May 31, if you have not signed up, do it NOW. 25% discount on all extensions for young business during the coronavirus pandemic','https://www.mageplaza.com/blog/covid-mageplaza-support-young-ebusiness-during-pandemic.html?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=sale-12',0,0),(13,4,'2020-06-08 16:43:12','Find out why Forrester positioned Adobe as a Leader in their latest B2B commerce report.','Read why Adobe was named a Leader in the ‚ÄúForrester Wave: B2B Commerce Suites, Q2 2020,‚Äù and discover how we can support your business with our global partner ecosystem. https://bit.ly/2z845hk','https://bit.ly/2z845hk',0,0),(14,4,'2020-06-10 00:00:00','8 New deals have been up. All hot extensions','8 high-demand Mageplaza extensions are on sales, up to 25% off. You don\'t want to miss them! Check it out NOW','https://www.mageplaza.com/deals/',0,0),(16,4,'2020-06-11 18:19:15','Ask us your questions during our upcoming webinar, The True Cost Savings of Magento Commerce 2.','Join us on Tuesday, June 23rd, for a new session of The True Cost Savings of Magento Commerce 2 now with extended time for live Q&amp;A. John Glasgow from Adobe will share how your business can reduce operating costs and grow revenue. And Slava Kravchuk from Atwix, # 1 Contributing Partner, will share a customer case study leading the way in innovative B2B retail experiences. Register Now: https://bit.ly/3dLYlsN','https://bit.ly/3dLYlsN',0,0),(19,4,'2020-06-16 19:19:54','Your input requested: Shipping &amp; Fulfillment','We would like to get your feedback on how you think about and manage your shipping &amp; fulfillment so we can build great features for you! http://selfserve.decipherinc.com/survey/selfserve/9d5/200603','http://selfserve.decipherinc.com/survey/selfserve/9d5/200603',0,0),(22,4,'2020-05-19 23:51:00','Watch our live webinar on-demand: Fast-Track Your Move to Magento Commerce.','Watch our on-demand webinar: Fast-Track Your Move to Magento Commerce. 5x Magento Master, Brent Peterson, will share insider advice on getting your new Magento Commerce site to market in 30 days or less. Also, Tricia Lee from Adobe will cover limited-time offers designed to help merchants upgrade quickly and affordably. View now: https://bit.ly/2L1lxpW','https://bit.ly/2L1lxpW',0,0),(23,4,'2020-06-25 21:45:31','We‚Äôre proud to be recognized as Leader in B2C commerce by Forrester in their latest report. ','Read the latest ‚ÄúForrester Wave: B2C Commerce Suites, Q2 2020‚Äù report to learn why ‚ÄúAdobe leads with flexibility, supported by a strong global partner ecosystem.‚Äù https://bit.ly/370vz4V','https://bit.ly/370vz4V',0,0),(24,4,'2020-06-26 17:15:35','Embrace digital change with insights from eCommerce leaders at Adobe Experience Maker\'s Live July 22-23.','Take part in 40+ diverse sessions at Experience Makers Live July 22-23, with topics including Magento Commerce product roadmap, delivered by John Stockton, Sr. Director of Product Marketing at Adobe, customer case studies highlighting real-world applications of Magento Commerce features and functionality, and how Magento Commerce is helping merchants adapt to the challenges of a new digital reality. Register today! https://adobe.ly/3i7XGnK','https://adobe.ly/3i7XGnK',0,0);
