INSERT INTO `catalog_product_entity_text` VALUES (10,75,0,4,'<p>Diese Kombination ist eine sehr elegante Mischung aus haupts√§chlich Rosen und Calla.Wir binden dieses Arrangement hoch, sodass jede einzelne Bl√ºte gut sichtbar ist.Umrandet wird der Strau√ü mit einer farblich dazu passender Papiermanschette.Das Original kann vom Foto abweichen.<br />Blumenzustellung in Wien.</p>'),(11,76,0,4,'<p>Diese Kombination ist eine sehr elegante Mischung aus haupts√§chlich Rosen und Calla.Wir binden dieses Arrangement hoch, sodass jede einzelne Bl√ºte gut sichtbar ist.Umrandet wird der Strau√ü mit einer farblich dazu passender Papiermanschette.Das Original kann vom Foto abweichen.<br />Blumenzustellung in Wien.</p>'),(12,85,0,4,'Blumenstrau√ü / Calla-Strau√ü'),(13,75,0,5,'<p>Die kraftvolle Farbkombination des Blumenstrau√ües l√§sst jedes tr√ºbes Gem√ºht fr√∂hlicher wirken. Eine haltbare Mischung zwischen Rosen, Hybericum und Solidago aufgelockert mit etwas Schleier, umh√ºllt mit Chiko, die jedoch nicht immer lagernd sind. Sollten wir am Liefertag keinen Chico haben, umrahmen wir den Strau√ü mit anderen Gr√ºn Blumenzustellung in Wien.</p>'),(14,76,0,5,'<p>Die kraftvolle Farbkombination des Blumenstrau√ües l√§sst jedes tr√ºbes Gem√ºht fr√∂hlicher wirken. Eine haltbare Mischung zwischen Rosen, Hybericum und Solidago aufgelockert mit etwas Schleier, umh√ºllt mit Chiko, die jedoch nicht immer lagernd sind. Sollten wir am Liefertag keinen Chico haben, umrahmen wir den Strau√ü mit anderen Gr√ºn Blumenzustellung in Wien.</p>'),(15,85,0,5,'Blumenstrauss Carli'),(16,75,0,6,'<p>Ein fr√∂hlicher Strau√ü von bunten Blumen. Gebunden und arrangiert so vielf√§ltig wie die Natur.<br />Die Blumen werden je nach Saison arrangiert.<br />Bei diesem Anblick erfreut sich jede Seele und die Sonne erscheint in dessen Herzen.<br />Blumenzustellung in Wien.</p>'),(17,76,0,6,'<p>Ein fr√∂hlicher Strau√ü von bunten Blumen. Gebunden und arrangiert so vielf√§ltig wie die Natur.<br />Die Blumen werden je nach Saison arrangiert.<br />Bei diesem Anblick erfreut sich jede Seele und die Sonne erscheint in dessen Herzen.<br />Blumenzustellung in Wien.</p>'),(18,85,0,6,'Blumenstrauss Bunter Fredy'),(19,75,0,7,'<p>Der Blumenstrauss Frank ist ein<br />Klassischer Strau√ü mit Standartblumen umrahmt von zartem Gr√ºn, <br />in diversen Farben erh√§ltlich.(Farbe eintragen im Kommentarfeld )<br />Blumenzustellung in Wien.</p>'),(20,76,0,7,'<p>Der Blumenstrauss Frank ist ein<br />Klassischer Strau√ü mit Standartblumen umrahmt von zartem Gr√ºn, <br />in diversen Farben erh√§ltlich.(Farbe eintragen im Kommentarfeld )<br />Blumenzustellung in Wien.</p>'),(21,85,0,7,'Blumenstrauss Frank'),(22,85,0,8,'Mo√´t & Chandon Brut Imp√©rial'),(29,138,0,7,'2-3 Tage'),(30,138,0,6,'2-3 Tage'),(31,138,0,5,'2-3 Tage'),(32,138,0,4,'2-3 Tage'),(33,75,0,15,'<p>Zusatzversand</p>'),(34,76,0,15,'<p>Zusatzversand</p>'),(35,85,0,15,'Zusatzversand'),(36,138,0,15,'2-3 Tage'),(37,138,0,8,'2-3 Tage'),(38,85,0,16,'Gru√ükarte Hochzeit'),(39,138,0,16,'2-3 Tage'),(40,85,0,17,'Gru√ükarte Hochzeit'),(41,138,0,17,'2-3 Tage'),(43,85,0,18,'Gru√ükarte Hochzeit'),(44,138,0,18,'2-3 Tage'),(46,75,0,19,'<p>Bunte Schnittblumenvariation. Erh√§ltlich in allen Farben.<br />Mit diesem Strau√ü k√∂nnen Sie nichts falsch machen, da ist sicher die Lieblingsblume auch dabei !</p>'),(47,76,0,19,'<p>Bunte Schnittblumenvariation. Erh√§ltlich in allen Farben.<br />Mit diesem Strau√ü k√∂nnen Sie nichts falsch machen, da ist sicher die Lieblingsblume auch dabei !</p>'),(48,85,0,19,'Kunterbunt '),(49,138,0,19,'1/2 Tage'),(50,85,0,20,'Blumenstrauss Elfi'),(51,138,0,20,'1/2 Tage'),(52,75,0,21,'<p>Dieses Arrangement ist gebunden,<br />in Prinzip wie ein runder Brautstrau√ü.<br />Kompakt, zartem Gr√ºn und cremefarbigen Rosen und ganz dezenten weissen Bl√ºten.</p>'),(53,76,0,21,'<p>Dieses Arrangement ist gebunden,<br />in Prinzip wie ein runder Brautstrau√ü.<br />Kompakt, zartem Gr√ºn und cremefarbigen Rosen und ganz dezenten weissen Bl√ºten.</p>'),(54,85,0,21,'Katharina'),(55,138,0,21,'1/2 Tage'),(56,75,0,22,'<p>Diesen Strauss kann man mit Worte nicht beschreiben!</p>\r\n<p>Die Kombination besteht aus 7 St√ºck Riesen Rosen,<br />extrem viele verschiedene Schnitt Gr√ºnsorten eine Bast Umrandung und nat√ºrlich einen s√º√üen Teddy.<br />Die Haltbarkeit dieses Arrangement ist 100% sehr, sehr lange und noch sp√§ter bleibt es Ewig in toller Erinnerung.</p>\r\n<p>(Teddy- B√§r)</p>'),(57,76,0,22,'<p>Diesen Strauss kann man mit Worte nicht beschreiben!</p>\r\n<p>Die Kombination besteht aus 7 St√ºck Riesen Rosen,<br />extrem viele verschiedene Schnitt Gr√ºnsorten eine Bast Umrandung und nat√ºrlich einen s√º√üen Teddy.<br />Die Haltbarkeit dieses Arrangement ist 100% sehr, sehr lange und noch sp√§ter bleibt es Ewig in toller Erinnerung.</p>\r\n<p>(Teddy- B√§r)</p>\r\n<p>Beispiebild, Original kann vom Sympolfoto abweichen.</p>'),(58,85,0,22,'Mr. Lover'),(59,138,0,22,'1/2 Tage'),(60,75,0,23,'<p>Sunny ist ein Blumenstrau√ü rund gebunden, Farben w√ºnsche werden ber√ºcksichtigt, au√üer rot.<br /><br /></p>\r\n<p><br /> Beispiel Foto, die Blumen k√∂nnen vom Symbolfoto abweichen.</p>'),(61,76,0,23,'<p>Sunny ist ein Blumenstrau√ü rund gebunden, Farben w√ºnsche werden ber√ºcksichtigt, au√üer rot.<br /><br /></p>\r\n<p><br /> Beispiel Foto, die Blumen k√∂nnen vom Symbolfoto abweichen.</p>'),(62,85,0,23,'Sunny'),(63,138,0,23,'1/2Tage'),(64,75,0,24,'<p>Dieses Arrangement wird gebunden mit wei√üen Lilien und rote Rosen.<br />In der Mitte sitzt ein kuschelweicher Teddy B√§r mit treuherzigen Augen.</p>\r\n<p>Eine kleine Liebesbotschaft, die alle sicher verstehen.</p>\r\n<p><br />Blumen sagen eben mehr als 1000 Worte !!</p>'),(65,76,0,24,'<p>Dieses Arrangement wird gebunden mit wei√üen Lilien und rote Rosen.<br />In der Mitte sitzt ein kuschelweicher Teddy B√§r mit treuherzigen Augen.</p>\r\n<p>Eine kleine Liebesbotschaft, die alle sicher verstehen.</p>\r\n<p><br />Blumen sagen eben mehr als 1000 Worte !!</p>\r\n<p>¬†</p>\r\n<p>Beispiel Foto, die Blumen k√∂nnen vom Symbolfoto abweichen.</p>'),(66,85,0,24,'Little love you'),(67,138,0,24,'1/2 Tage'),(68,75,0,25,'<p>Biedermeier Strau√ü nach guter alter Tradition gestaltet.</p>\r\n<p>Ein Kopf an Kopf gebundener Strau√ü mit Manschette.<br />Die Farbzusammenstellung kann, muss aber nicht harmonisch abgestimmt werden.</p>'),(69,76,0,25,'<p>Biedermeier Strau√ü nach guter alter Tradition gestaltet.</p>\r\n<p>Ein Kopf an Kopf gebundener Strau√ü mit Manschette.<br />Die Farbzusammenstellung kann, muss aber nicht harmonisch abgestimmt werden.</p>\r\n<p>Beispiel Foto, die Blumen k√∂nnen vom Symbolfoto abweichen.</p>'),(70,85,0,25,'Blumenstrauss\" Betti \"'),(71,138,0,25,'1/2 Tage'),(72,85,0,26,'Blumenstrauss mit Schutzengel'),(73,138,0,26,'1/2 Tage'),(74,75,0,27,'<p>Der¬†Rote¬†Rosenstrau√ü¬†wird¬†rund arrangiert,</p>\r\n<p>f√ºr verliebte das richtige.</p>\r\n<p><br /> Beispiel Foto, die Blumen k√∂nnen vom Symbolfoto abweichen.</p>'),(75,76,0,27,'<p>Der¬†Rote¬†Rosenstrau√ü¬†wird¬†rund arrangiert,</p>\r\n<p>f√ºr verliebte das richtige.</p>\r\n<p><br /> <br /> Beispiel Foto, die Blumen k√∂nnen vom Symbolfoto abweichen.</p>'),(76,85,0,27,'roter Rosen Blumenstrauss'),(77,138,0,27,'1/2 Tage'),(78,85,0,28,'Rosenkranz rosa Rosen mit Gysovilla'),(79,138,0,28,'2-3 Tage'),(80,75,0,29,'<p>Die wei√üe Pracht ist ein Blumenstrau√ü</p>\r\n<p>mit wei√üen Lilien und Rosen.</p>'),(81,76,0,29,'<p>Die wei√üe Pracht ist ein Blumenstrau√ü</p>\r\n<p>mit wei√üen Lilien und Rosen.</p>'),(82,85,0,29,'Wei√üe Pracht'),(83,138,0,29,'1/2 Tage'),(92,75,0,32,'<p>Trauerkranz Hauptkranz nur mit Kopf in Rosa gehalten.</p>\r\n<p>¬†</p>\r\n<p>¬†</p>'),(93,76,0,32,'<p>Trauerkranz Hauptkranz nur mit Kopf in rosa gehalten.</p>'),(94,85,0,32,'Begr√§bniskrantz Altrosa,Luisiantus,Kohl '),(95,138,0,32,'2-3 Tage'),(96,75,0,33,'<p>Dieser Kranz wurde in wei√ü-gr√ºn kombiniert.<br />Nat√ºrlich k√∂nnen sie uns auch ihre Farben Auswahl bekannt geben.<br />Ein Biedermeier Kranz hat keine Erh√∂hung und die Blumen werden mit der runden Kranzform\" vereint.\"<br />Preis ohne Schleife</p>'),(97,76,0,33,'<p>Dieser Kranz wurde in wei√ü-gr√ºn kombiniert.<br />Nat√ºrlich k√∂nnen sie uns auch ihre Farben Auswahl bekannt geben.<br />Ein Biedermeier Kranz hat keine Erh√∂hung und die Blumen werden mit der runden Kranzform\" vereint.\"<br />Preis ohne Schleife</p>'),(98,85,0,33,'Biedermeier Kranz'),(99,138,0,33,'2-3 Tage'),(100,85,0,34,'Bunter Begr√§bniskranz'),(101,138,0,34,'2-4 Tage'),(102,75,0,34,'<p>Der bunte Wiesen Begr√§bnis Kranz</p>\r\n<p>Diesen Kranz empfehlen wir f√ºr alle die immer sehr fr√∂hlich waren und die Natur noch zu sch√§tzen wusste.<br />Die Art und die Farbe der Blumen sind total verschieden und bunt.</p>\r\n<p>Der Abgebildete Trauerkranz hat die Gr√∂√üe von einem Hauptkranz!<br />Schleifendruck mit pers√∂nlichem Text m√∂glich.<br />Preis der Schleife ist extra</p>'),(103,76,0,34,'<p>Der bunte Wiesen Begr√§bnis Kranz </p>\r\n<p>Diesen Kranz empfehlen wir f√ºr alle die immer sehr fr√∂hlich waren und die Natur noch zu sch√§tzen wusste.<br />Die Art und die Farbe der Blumen sind total verschieden und bunt.</p>\r\n<p>Der Abgebildete Trauerkranz hat die Gr√∂√üe von einem Hauptkranz!<br />Schleifendruck mit pers√∂nlichem Text m√∂glich.<br />Preis der Schleife ist extra</p>'),(104,75,0,35,'<p>Test</p>'),(105,76,0,35,'<p>Test</p>'),(106,85,0,35,'Test'),(107,138,0,35,'2-3 Tage'),(109,75,2,4,'Diese Kombination ist eine sehr elegante Mischung aus haupts√§chlich Rosen und Calla.Wir binden dieses Arrangement hoch, sodass jede einzelne Bl√ºte gut sichtbar ist.Umrandet wird der Strau√ü mit einer farblich dazu passender Papiermanschette.Das Original kann vom Foto abweichen.\r\nBlumenzustellung in Wien.');
