INSERT INTO `checkout_agreement` VALUES (1,'AGB','Allgemeine Gesch√§ftsbedingungen\r\nStand vom 9. September 2003\r\n\r\n    1. GELTUNSBEREICH\r\n\r\n    Die nachfolgend genannten Allgemeinen Gesch√§ftsbindungen (AGB) und Nutzungsbedingungen finden ohne Ausnahme auf jede Rechtsbeziehung zwischen Blumen Claudia (blumenclaudia.at)\r\n\r\n    - nachfolgend Blumen Claudia benannt -\r\n\r\n    und ihren Nutzern der Online- oder anderweitigen Dienstleistungen, die Blumen Claudia erbringt, Anwendung.\r\n\r\n    Der Nutzer erkennt mit der Inanspruchnahme der Internetseite, blumenclaudia.at, diese und von Blumen Claudia zuk√ºnftig ge√§nderte Bestimmung an, es sei denn eine gesondert schriftliche anderweitige Regelung ist Grundlage der Rechtsbeziehung oder ein Nutzer widerspricht den ge√§nderten Bestimmungen innerhalb 14 Tagen, nachdem Blumen Claudia online die ge√§nderten Bestimmungen angezeigt hat. F√ºr den Fall des Widerspruches besteht ein au√üerordentliches K√ºndigungsrecht von Seiten Blumen Claudia mit einer K√ºndigungsfrist von 14 Tagen.\r\n\r\n    Anderweitige Nutzung, ohne Anerkenntnis der AGB und Nutzungsbedienungen, ist ausnahmslos untersagt.\r\n\r\n    Entgegenstehende AGB finden nur bei ausdr√ºcklicher schriftlicher Best√§tigung Annahmeerkl√§rung durch Blumen Claudia Anwendung; im √úbrigen gelten diese nicht Blumen Claudia gegen√ºber.\r\n    2. VERTRAGSANNAHME - UND ANGEBOT\r\n\r\n    Die von Blumen Claudia √ºbersandten Vertragsvereinbarungen, sei es √ºber elektronisches Medium oder per Briefverkehr, werden durch Annahme des Kundenantrages verbindlich, sei es √ºber elektronisches Medium oder per Briefverkehr; im √úbrigen jedoch nicht. Die von Blumen Claudia √ºbersandten Vertragsvereinbarungen sind unverbindlich und gelten nicht als Angebot. Minderj√§hrige sind zum Vertragschluss nicht berechtigt; Kunden, die in ihrer Gesch√§ftsf√§higkeit beschr√§nkt sind, haben eine schriftliche Zustimmungserkl√§rung eines gesetzlichen Vertreters dem Kundenantrag beizuf√ºgen oder