 - Nutzungsbedingungen\r\n\r\n    Blumen Claudia weist ausdr√ºcklich darauf hin, dass es keine absolute Datensicherheit gew√§hrleisten kann. Dieses insbesondere bei der √úbertragung von Daten.\r\n\r\n    Blumen Claudia f√ºhrt keine Datensicherung aus. Der Nutzer steht zur Datensicherung in Eigenverantwortung. Dieses betrifft ebenso die Sicherheit und Funktionsf√§higkeit der jeweiligen Kunden-/Bestelldaten.\r\n\r\n    Der Nutzer ist zur Einhaltung der Nettiquette grunds√§tzlich verpflichtet. An Verhaltensregeln gelten die international √ºblichen. Blumen Claudia beh√§lt sich vor, diese gegebenenfalls einzuschr√§nken. Stellt Blumen Claudia Zuwiderhandlungen fest, berechtigt dieses zur fristlosen K√ºndigung, sowie Sperrung des Kundenkontos. Das jeweilige Ermessen liegt bei Blumen Claudia.\r\n\r\n    Jeder Nutzer verpflichtet sich bei Nutzung √ºber seinen gesundheitlichen Zustand vorab zu informieren, um keine gesundheitlichen Sch√§den zu erleiden. Wie weisen insbesondere darauf hin, dass bestimmte Bildschirminhalte epileptische Anf√§lle hervorrufen k√∂nnen. Eine Haftung hierf√ºr kann Blumen Claudia nicht √ºbernehmen.\r\n\r\n    Unbeschadet etwaiger Schadensersatzanspr√ºche von Blumen Claudia sind im Falle der R√ºcktrittserkl√§rung erbrachte Leistungen oder Teilleistungen vertragsgem√§√ü abzurechnen und zu bezahlen.\r\n\r\n    Dem Nutzer stehen keine R√ºcktrittsrechte zu, es sei denn, diese sind zwingend gesetzlich vorgeschrieben.\r\n    7. VERZICHT UND SCHADENSERSATZ\r\n\r\n    Der Nutzer verzichtet vollumf√§nglich auf s√§mtliche Schadensersatzanspr√ºche gegen√ºber Blumen Claudia. Der Verzicht erstreckt sich insbesondere auf Leistungen, die in Zusammenhang mit √úbertragungen von Blumen Claudia stehen, an Besch√§digungen an der Hard- und Software, unabh√§ngig von der Ursache (Viren, usw.). Hiervon ausgenommen sind Verletzungen von Leben, K√∂rper und Gesundheit.\r\n    8. GEW√ÑHRLEISTUNGS- und HAFTUNGSAUSSCHLUSS\r\n\r\n    Blumen Claudia schlie√üt jegliche, gesetzliche zu