hen Schutz. Den Nutzern der http://www.blumenclaudia.at und der angebotenen Dienste ist es demgem√§√ü untersagt, diese Inhalte ohne vorhergehende schriftliche Zustimmung in bearbeiteter oder unbearbeiteter Form zu vervielf√§ltigen, zu verbreiten, zu senden, √∂ffentlich vorzuf√ºhren, in Datenbanken oder Speicher √§hnlicher Art einzubringen, einzuspeisen, vorzuhalten und an die √ñffentlichkeit zu √ºbermitteln (\"communication to the public\") oder zu sonstigen Zwecken zu nutzen.\r\n    11. ZAHLUNGSBEDNIGUNGEN\r\n\r\n    F√ºr den Fall der R√ºckbelastung √ºbernimmt der Nutzer die entstandenen Kosten zuz√ºglich den unter dem Gesichtspunkt des Verzuges entstanden Rechtsverfolgungskosten, die Blumen Claudia entstanden sind.\r\n\r\n    Andere schriftlich vereinbarte Zahlungsmodalit√§ten sind mit Wertstellung bis zum dritten Werktages eines Monats im Voraus zu entrichten, soweit monatliche Zahlung vereinbart ist; andernfalls im Voraus in voller H√∂he des vereinbarten Entgeltes. Ma√ügeblich ist hierf√ºr der Wertstellungstag auf dem Gesch√§ftskonto von Blumen Claudia.\r\n    12. SONSTIGE BESTIMMUNGEN\r\n\r\n    Blumen Claudia ist auf eigenes Risiko erm√§chtigt Dritte zu beauftragen mit Erbringung von Leistungen, die auf ein Vertragsverh√§ltnis mit dem Nutzer beruhen.\r\n\r\n    Der Nutzer ist √ºber jede √Ñnderung seiner Anschrift, Namen, Rechtsform oder anderweitigen Identifikationsmerkmal verpflichtet Blumen Claudia innerhalb eines Monats anzuzeigen. Unterl√§sst der Nutzer diese anzeige, gelten s√§mtliche Erkl√§rungen als zugegangen, soweit sie auf den nicht ge√§nderten Daten beruhen.\r\n\r\n    Sollten einzelne Vertragsbedingungen unwirksam sein, gelten hierf√ºr die gesetzlichen Bestimmungen, der Vertrag bleibt f√ºr die √ºbrigen Bedingungen g√ºltig.\r\n\r\n    Der Nutzer ist zur Geheimhaltung seiner pers√∂nlichen Daten, u.a. Passwort, verpflichtet. Bei Verst√∂√üen haftet der Nutzer in vollem Umfang. Es steht Blumen Claudia frei, fristlose K√ºndigung zu erkl√§ren.\r\n    13. 