\" src=\"{{media url=&quot;categ_8.png&quot;}}\" alt=\"\">{{widget type=\"Magento\\Catalog\\Block\\Category\\Widget\\Link\" template=\"category/widget/link/link_block.phtml\" id_path=\"category/15\"}}</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>','2020-03-27 18:22:25','2020-06-16 18:16:36',1),(6,'Presentation_home','Presentation_home','<div class=\"std\">\r\n<h4><strong>BlumenClaudia.at - Onlineshop</strong></h4>\r\n<p>Welcome visitor! Would you like to <a href=\"{{config path=\"web/unsecure/base_url\"}}customer/account/login/\">register?</a> Or would you prefer to <a href=\"{{config path=\"web/unsecure/base_url\"}}customer/account/create/\">create an account?</a></p>\r\n<p>We deliver flowers and nice gift ideas personally all over Vienna at a flat rate. We are not an anonymous broker of services, you buy directly in the shop with a quality guarantee!</p>\r\n<p>Personal delivery in Vienna is possible at the earliest 2 to 3 hours after the order has been accepted. We also deliver on Sundays!</p>\r\n<p>Flower delivery directly from the flower shop, personally delivered throughout Vienna! We are characterized by service, quality and the ability to fulfill our customers\' almost every wish.</p>\r\n</div>','2020-03-27 18:22:55','2020-03-27 18:22:55',1),(7,'Presentation_home','Presentation_home-g','<div class=\"std\">\r\n<h4><strong>BlumenClaudia.at - Onlineshop</strong></h4>\r\n<p>Herzlich Willkommen Besucher! M√∂chten Sie sich <a href=\"{{config path=\"web/unsecure/base_url\"}}customer/account/login/\">anmelden?</a> Oder wollen Sie ein <a href=\"{{config path=\"web/unsecure/base_url\"}}customer/account/create/\">Kundenkonto</a> er√∂ffnen?</p>\r\n<p>Blumen und nette Geschenksideen stellen wir in ganz Wien zum Pauschalpreis pers√∂nlich zu. Wir sind kein anonymer Vermittler von Diensleistungen, Sie kaufen direkt im Gesch√§ft mit Qualit√§tsgarantie!</p>\r\n<p>Pers√∂nliche Zustellung in Wien fr√ºhestens 2 bis 3 Stunden nach Bestellannahme m√∂glich. Wir liefern auch am Sonntag!</p>\r\n<p>Blumenzustellung direkt aus dem Blumengesch√§ft, in ganz Wien pers√∂nlich zugestellt! Service, Qualit√§t und die M√∂glichkeit unseren Kunden fast jeden Wunsch zu erf√ºllen, zeichnen uns aus.</p>\r\n</div>','2020-03-27 18:22:55','2020-03-27 18:30:37',1),(10,'home-flower','home-flower','<div style=\"font-size: 20px; margin: 40px 0 0px; text-align: center;\">Bitte w√§hlen Sie die Kategorie aus:</div>\r\n<p>&nbsp;</p>\r\n<div class=\"home-flower-container\" style=\"background-image: url(\'http://www.blumen-zustellung.at/pub/media/flower_1.png\');\">\r\n<div style=\"width: 100%; height: 100%;\">\r\n<div style=\"width: 100%; height: 25%; display: flex;\">\r\n<div style=\"width: 28%;\">&nbsp;</div>\r\n<div class=\"flower-widget-container\" style=\"width: 18%; margin-top: 14%; position: relative;\"><img class=\"cat-image\" src=\"{{media url=&quot;categ_1.png&quot;}}\" alt=\"\">{{widget type=\"Magento\\Catalog\\Block\\Category\\Widget\\Link\" template=\"category/widget/link/link_block.phtml\" id_path=\"category/16\"}}</div>\r\n<div class=\"flower-widget-container\" style=\"width: 18%; margin-top: 12%; margin-left: 1%; position: relative;\"><img class=\"cat-image\" src=\"{{media url=&quot;categ_2.png&quot;}}\" alt=\"\">{{widget type=\"Magento\\Catalog\\Block\\Category\\Widget\\Link\" template=\"category/widget/link/link_block.phtml\" id_path=\"category/8\"}}</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n<div style=\"width: 100%; height: 20%; display: flex;\">\r\n<div class=\"flower-widget-container\" style=\"width: 35%; position: relative;\"><img class=\"cat-image\" style=\"max-height: 90%; margin-left: 40%; margin-top: 33%;\" src=\"{{media url=&quot;categ_3.png&quot;}}\" alt=\"\">{{widget type=\"Magento\\Catalog\\Block\\Category\\Widget\\Link\" template=\"category/widget/link/link_block.phtml\" id_path=\"category/9\"}}</div>\r\n<div style=\"width: 50%;\">&nbsp;</div>\r\n<div class=\"flower-widget-container\" style=\"width: 25%; margin-right: 10%; position: