ns 1 Stunde in den Kommentarfeldern bei Ihrer Bestellung im Onlineshop an oder wenden Sie sich direkt w√§hrend unserer Gesch√§ftszeiten telefonisch unter +43 (1) 486 99 54 an uns.</p>\r\n<p>Wenn Sie einen Blumengru√ü als Geschenk bestellen, bitten wir zus√§tzlich um die Telefonnummer des Empf√§ngers, damit die Auslieferung reibungslos klappt. Sollte der Empf√§nger nicht angetroffen werden k√∂nnen, ist Blumen Claudia und seine Erf√ºllungsgehilfen berechtigt, auch als geeignet erscheinende dritten den Blumengru√ü zur Weiterleitung an den Empf√§nger zu √ºbergeben, oder diese (wenn m√∂glich) vor die T√ºre zu legen.</p>\r\n<p>Sollte der Empf√§nger nicht angetroffen werden k√∂nnen, gilt die Zustellung dennoch als durchgef√ºhrt. Neuerliche Zustellungen sind leider nur gegen Aufpreis m√∂glich. Mehrkosten, die durch den erfolglosen Versuch ordnungsgem√§√üer Auslieferung entstehen, k√∂nnen dem Kunden gesondert in Rechnung gestellt werden. F√ºr die Richtigkeit und Vollst√§ndigkeit der Lieferadresse tr√§gt der Kunde die Verantwortung.<br> Sollte es wegen irgendeiner falsch ausgef√ºllter Lieferadresse oder das Fehlen der Telefonnummer beziehungsweise nicht erreichbar sein,<br> wird das Bestellte Produkt um Euro 9,00 ( Zusatzkosten) in unser Gesch√§ft zur√ºck gebracht. Weiteres vorgehen wird mit der Kunde besprochen.</p>\r\n<p>Wir danken f√ºr Ihr Interesse</p>','2020-03-31 08:25:50','2020-05-25 09:13:49',1,0,'','','',NULL,NULL,NULL,''),(14,'Versand','1column','','','lieferung','','<h4><strong>Delivery information</strong></h4>\r\n\r\n<p>Explanation:<br>\r\nWe have no hidden costs,<br>\r\nThe FLOWER VALUE is preserved and does not suffer from the delivery charges !!<br>\r\n(If a competitor offers a cheaper delivery, <br>\r\nthis usually takes the difference from the flowers or other hidden costs.)\r\n\r\n<p> Flowers Claudia delivers fresh flowers to you every day of the week until 7 p.m. in the Vienna area\r\nfor a flat rate of 14.50 euros in the districts 1070, 1080, 1140, 1150, 1160, 1170 <br>\r\nfor a flat rate of 14.50 euros in the districts 1010, 1020, 1030, 1040, 1050, 1060, 1090, 1100, 1110, 1120, 1130, 1180, 1190, 1200 <br>\r\nfor a flat rate of 16.50 euros in the districts 1210, 1220, 1230 including VAT\r\nOrders are accepted Monday to Friday 6 p.m. Orders for Saturday and Sunday delivery are Saturday at 12 noon\r\n(Orders placed on Sunday will only be processed on Monday from 8 a.m.)\r\nSunday\'s delivery is possible by arrangement from 9.30 to 12.30! </p>\r\n\r\n<p> In principle, special delivery dates and times (including Sundays and public holidays) are also possible at no additional cost in addition to our flat rate, however, for organizational reasons, please arrange with us personally 24 hours in advance. Please indicate special delivery requests with a time window of at least 1 hour in the comment fields when placing your order in the online shop or contact us directly during our business hours on +43 (1) 486 99 54. </p>\r\n\r\n<p> If you order a flower greeting as a gift, we also ask for the recipient\'s phone number so that the delivery goes smoothly. If the recipient cannot be found, Blumen Claudia and his vicarious agents are entitled to hand over the flower greeting to the recipient as a suitable third party, or to put it outside the door (if possible). </p>\r\n\r\n<p> If the recipient cannot be found, the delivery is still considered to have been carried out. Unfortunately, new deliveries are only possible at an additional cost. Additional costs that arise from the unsuccessful attempt to deliver properly can be invoiced separately to the customer. The customer is responsible for the correctness and completeness of the delivery address. <br>\r\nShould it be unavailable due to some wrongly filled delivery address or the lack of the telephone number, <br>\r\nthe ordered product will be returned to our shop for Euro 9.00 (additional costs). Further steps will be discussed with the customer. </p>\r\n\r\n<p> Thank you for your interest </p>','2020-03-31 08:27:10','2020-03-31 08:27:10',1,0,'','','',NULL,NULL,NULL,''),(15,'R√ºcktrittsrecht / Widerrufsbelehrung','1column','','','widerruf','','<h2><strong>R√ºcktrittsrecht / Widerrufsbelehrung</strong></h2>\r\n<div class=\"main-container col1-layout\">\r\n<div class=\"main\">\r\n<div class=\"col-main\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12\">\r\n<div>\r\n<p>Verbraucher gem. KSchG haben das Recht, binnen vierzehn Tagen ohne Angabe von Gr√ºnden diesen Vertrag zu widerrufen.</p>\r\n<p>Die Widerrufsfrist betr√§gt vierzehn Tage ab dem Tag, an dem der Kunde oder ein vom Kunden benannter Dritter, der nicht der Bef√∂rderer ist, die Waren in Besitz genommen haben bzw. hat.</p>\r\n<p>Um das Widerrufsrecht auszu√ºben, muss der Kunde uns, mittels einer eindeutigen Erkl√§rung (z.B. ein mit der Post versandter Brief oder E-Mail) √ºber den Entschluss, diesen Vertrag zu widerrufen, informieren. Der Kunde kann daf√ºr das beigef√ºgte Muster-Widerrufsformular verwenden, das jedoch nicht vorgeschrieben ist. Der Verbraucher kann das Muster-Widerrufsformular oder eine andere eindeutige Erkl√§rung auch auf unserer Webseite elektronisch ausf√ºllen und √ºbermitteln. Macht der Kunde von dieser M√∂glichkeit Gebrauch, so wird ihm unverz√ºglich (z. B. per E-Mail) eine Best√§tigung √ºber den Eingang eines solchen Widerrufs √ºbermittelt.</p>\r\n<p>Zur Wahrung der Widerrufsfrist reicht es aus, dass der Verbraucher die Mitteilung √ºber die Aus√ºbung des Widerrufsrechts vor Ablauf der Widerrufsfrist absendet.</p>\r\n<p><strong>Folgen des Widerrufs (lt. Widerrufsbelehrung)</strong></p>\r\n<p>Wenn Sie diesen Vertrag widerrufen, haben wir Ihnen alle Zahlungen, die wir von Ihnen erhalten haben, einschlie√ülich der Lieferkosten (mit Ausnahme der zus√§tzlichen Kosten, die sich daraus ergeben, dass Sie eine andere Art der Lieferung als die von uns angebotene, g√ºnstigste Standardlieferung gew√§hlt haben), unverz√ºglich und sp√§testens binnen vierzehn Tagen ab dem Tag zur√ºckzuzahlen, an dem die Mitteilung √ºber Ihren Widerruf dieses Vertrags bei uns eingegangen ist.</p>\r\n<p>F√ºr diese R√ºckzahlung verwenden wir dasselbe Zahlungsmittel, das Sie bei der urspr√ºnglichen Transaktion eingesetzt haben, es sei denn, mit Ihnen wurde ausdr√ºcklich etwas anderes vereinbart; in keinem Fall werden Ihnen wegen dieser R√ºckzahlung Entgelte berechnet. Sie haben die Waren unverz√ºglich und in jedem Fall sp√§testens binnen vierzehn Tagen ab dem Tag, an dem Sie uns √ºber den Widerruf dieses Vertrags unterrichten, an uns zur√ºckzusenden oder zu √ºbergeben. Die Frist ist gewahrt, wenn Sie die Waren vor Ablauf der Frist von vierzehn Tagen absenden. Sie tragen die unmittelbaren Kosten der R√ºcksendung der Waren. Sie m√ºssen f√ºr einen etwaigen Wertverlust der Waren nur aufkommen, wenn dieser Wertverlust auf einen zur Pr√ºfung der Beschaffenheit, Eigenschaften und Funktionsweise der Waren nicht notwendigen Umgang mit ihnen zur√ºckzuf√ºhren ist.</p>\r\n<p>&nbsp;</p>\r\n<h2>Formular zur Widerrufsbelehrung</h2>\r\n</div>\r\n<div class=\"std\">\r\n<p>An</p>\r\n<div style=\"width: 25%;\">\r\n<p><strong>Blumen Claudia / Blumensalon Monika</strong><br>Linzerstra√üe 59<br>1140 Wien<br>Telefon: +43 (0)1 486 99 54</p>\r\n<p>E-Mail: office@blumenclaudia.at</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>Hiermit widerrufe(n) ich/wir<sup>*</sup> den von mir/uns<sup>*</sup> abgeschlossenen Vertrag √ºber den Kauf der folgenden Waren<sup>*</sup> / die Erbringung der folgenden Dienstleistung<sup>*<br><br><br><br></sup></p>\r\n<p style=\"padding-top: 14px;\">&nbsp;</p>\r\n<hr style=\"width: 50%;\">Bestellt am<sup>*</sup>/ erhalten am<sup>*</sup>\r\n<p>&nbsp;</p>\r\n<p style=\"padding-top: 14px;\">&nbsp;</p>\r\n<hr style=\"width: 50%;\">Name des/der Verbraucher(s)\r\n<p>&nbsp;</p>\r\n<p style=\"padding-top: 14px;\">&nbsp;</p>\r\n<hr style=\"width: 50%;\">Anschrift des/der Verbraucher(s)\r\n<p>&nbsp;</p>\r\n<p style=\"padding-top: 14px;\">&nbsp;</p>\r\n<hr style=\"width: 50%;\">Unterschrift des/der Verbraucher(s) <em>(nur bei Mitteilung auf Papier)</em>\r\n<p>&nbsp;</p>\r\n<p style=\"padding-top: 14px;\">&nbsp;</p>\r\n<hr style=\"width: 50%;\">Datum\r\n<p>&nbsp;</p>\r\n<p><sup>*</sup> Unzutreffendes streichen.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2020-05-25 09:07:34','2020-05-25 09:16:32',1,0,'','','',NULL,NULL,NULL,''),(16,'Datenschutzerkl√§rung','1column','','','datenschutz','','<div class=\"std\">\r\n<h2><strong>Datenschutz</strong></h2>\r\n<p><strong>Erkl√§rung zur Informationspflicht</strong></p>\r\n<p><strong>(Datenschutzerkl√§rung)</strong></p>\r\n<p>Der Schutz Ihrer pers√∂nlichen Daten ist uns ein besonderes Anliegen. Wir verarbeiten Ihre Daten daher ausschlie√ülich auf Grundlage der gesetzlichen Bestimmungen (DSGVO). In diesen Datenschutzinformationen informieren wir Sie √ºber die wichtigsten Aspekte der Datenverarbeitung im Rahmen unserer Website.&nbsp;</p>\r\n<p><strong>Kontakt mit uns</strong></p>\r\n<p>Wenn Sie per Formular auf der Website oder per E-Mail Kontakt mit uns aufnehmen, werden Ihre angegebenen Daten zwecks Bearbeitung der Anfrage und f√ºr den Fall von Anschlussfragen sechs Monate bei uns gespeichert. Diese Daten geben wir nicht ohne Ihre Einwilligung weiter.&nbsp;</p>\r\n<p><strong>Datenspeicherung</strong></p>\r\n<p>Wir weisen darauf hin, dass zum Zweck des einfacheren Einkaufsvorganges und zur sp√§teren Vertragsabwicklung vom Webshop-Betreiber im Rahmen von Cookies die IP-Daten des Anschlussinhabers gespeichert werden, ebenso wie Name und Anschrift des K√§ufers.</p>\r\n<p>Die von Ihnen bereit gestellten Daten sind zur Vertragserf√ºllung bzw zur Durchf√ºhrung vorvertraglicher Ma√ünahmen erforderlich. Ohne diese Daten k√∂nnen wir den Vertrag mit Ihnen nicht abschlie√üen. Eine Daten√ºbermittlung an Dritte erfolgt nicht, mit Ausnahme der √úbermittlung der Kreditkartendaten an die abwickelnden Bankinstitute / Zahlungsdienstleister zum Zwecke der Abbuchung des Einkaufspreises, an das von uns beauftragte Transportunternehmen/Versandunternehmen zur Zustellung der Ware sowie an unseren Steuerberater zur Erf√ºllung unserer steuerrechtlichen Verpflichtungen.</p>\r\n<p>Im Falle eines Vertragsabschlusses werden s√§mtliche Daten aus dem Vertragsverh√§ltnis bis zum Ablauf der steuerrechtlichen Aufbewahrungsfrist (7 Jahre) gespeichert.&nbsp;&nbsp;</p>\r\n<p>Die Daten Name, Anschrift, gekaufte Waren und Kaufdatum werden dar√ºber hinausgehend bis zum Ablauf der Produkthaftung (10 Jahre) gespeichert. Die Datenverarbeitung erfolgt auf Basis der gesetzlichen Bestimmungen der DSGVO.&nbsp;&nbsp;</p>\r\n<p><strong>Cookies</strong></p>\r\n<p>Unsere Website verwendet so genannte Cookies. Dabei handelt es sich um kleine Textdateien, die mit Hilfe des Browsers auf Ihrem Endger√§t abgelegt werden. Sie richten keinen Schaden an.</p>\r\n<p>Wir nutzen Cookies dazu, unser Angebot nutzerfreundlich zu gestalten. Einige Cookies bleiben auf Ihrem Endger√§t gespeichert, bis Sie diese l√∂schen. Sie erm√∂glichen es uns, Ihren Browser beim n√§chsten Besuch wiederzuerkennen.</p>\r\n<p>Wenn Sie dies nicht w√ºnschen, so k√∂nnen Sie Ihren Browser so einrichten, dass er Sie √ºber das Setzen von Cookies informiert und Sie dies nur im Einzelfall erlauben.</p>\r\n<p>Bei der Deaktivierung von Cookies kann die Funktionalit√§t unserer Website eingeschr√§nkt sein.</p>\r\n<p><strong>Ihre Rechte</strong></p>\r\n<p>Ihnen stehen grunds√§tzlich die Rechte auf Auskunft, Berichtigung, L√∂schung, Einschr√§nkung, Daten√ºbertragbarkeit, Widerruf und Widerspruch zu. Wenn Sie glauben, dass die Verarbeitung Ihrer Daten gegen das Datenschutzrecht verst√∂√üt oder Ihre datenschutzrechtlichen Anspr√ºche sonst in einer Weise verletzt worden sind, k√∂nnen Sie sich bei der Aufsichtsbeh√∂rde beschweren.</p>\r\n<p><strong>Sie erreichen uns unter folgenden Kontaktdaten:</strong></p>\r\n<div class=\"col xmedium-6\">\r\n<p>Blumen Claudia / Blumensalon Monika<br>Linzerstra√üe